import { Route, Routes, BrowserRouter } from "react-router-dom";
import GlobalStyles from "./GlobalStyle";

function App() {
  return (
    <BrowserRouter>
      <GlobalStyles />
      <Routes>
        <Route path="/"></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
